  false,\n\t\"url\": null,\n\t\"notes\": \"The version 6 Gross Primary Productivity
  (GPP) product is a cumulative 8-day composite of values with 500 meter pixel size
  based on the radiation-use efficiency concept that can be potentially used as inputs
  to data models to calculate terrestrial energy, carbon, water cycle processes, and
  biogeochemistry of vegetation. The data product includes information about Gross
  Primary Productivity (GPP) and Net Photosynthesis (PSN). The PSN band values are
  the GPP minus the Maintenance Respiration (MR). The data product also contains a
  PSN Quality Control layer. The quality layer contains quality information for both
  the GPP and the PSN. Information on individual MODIS GPP Products along with improvements/changes
  for Version 6 are available at: https://lpdaac.usgs.gov/dataset_discovery/?f[0]=im_field_dataset_version%3A32&f[1]=im_field_product%3A5.\",\n\t\"license_title\":
